/** @format */

import { useParams } from "react-router";

const ColorPage = ({ colors }) => {
  let params = useParams();
  let colorArr = colors.filter((c) => {
    return c === params.color;
  });
  let color = colorArr[0];
  return (
    <div
      style={{
        backgroundColor: { color },
        width: "4000px",
        height: "1000px",
      }}
    ></div>
  );
};

export default ColorPage;
